import React, { Component } from "react";
import { connect } from "react-redux";

class SquareOfCheckboxTable extends Component {
  render() {
    return <div></div>;
  }
}

let mapStateToProps = (state) => {
  state.chairList.map((index, key) => console.log(index.hang));

  return {
    seatsInput: state,
  };
};

export default connect(mapStateToProps)(SquareOfCheckboxTable);
